import React from "react";
import { Text } from "react-native";

export default function Person({ id }) {
  const url = "https://swapi.dev/api/people/" + id;
  console.log(url);

  const fetchPerson = () => {
    fetch(url)
      .then((data) => data.json())
      .then((person) => {
        console.log(person);
      });
  };

  React.useEffect(fetchPerson, []);

  return <Text>{id}</Text>;
}
